import React, { useState, useEffect } from 'react';

function Dashboard(data){
    const [info, setData] = useState('');

    useEffect(() =>{
        setData(data.data);
    }, []);

    if(Object.keys(info).length === 0){
        return(
            <div className="dashboard">
                <div className="container mt-5">
                    NO DATA
                </div>
            </div>
        )
    }else{
        return(

            <div className="dashboard">
                <div className="container mt-5">
                    There is DATA
                </div>
            </div>
        )
    }
}

export default Dashboard;
